import React , {Component} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import $ from 'jquery';
import 'jquery-ui-bundle';
import 'jquery-ui-bundle/jquery-ui.css';
import data from './data';
import ReactTable from 'react-table';
import 'react-table/react-table.css';

class AdminTeacherProfile extends Component{

    constructor(){
        super();
        this.state = {
          data : []
        }
      }
    componentDidMount(){
        $(function(){
          $('.datepicker').datepicker();
        });
        this.setState({
          data : data
        })
      }
    render() { 
    
        const columns = [
          {
            Header : 'Class',
            accessor : 'class',
            maxWidth : 80,
            
          },
          {
            Header : 'Section',
            accessor : 'section'
          },
          {
            Header : 'Time',
            accessor : 'time'
          }
        ]
    
        return (
          <div className="App">
            <Container>
            <h1>Teacher</h1>
            <Row>
      
              <Col sm={8}>
      
                <Card className = 'p-4'>
      
                  <Form className="m-4">
      
                    <Row className="mt-4">
                      <Col>
                        <Form.Label>Username</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                    </Row>
      
                    <Row className="mt-4">
                      <Col>
                        <Form.Label>Register Number</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                      <Col>
                        <Form.Label>Register Date</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                    </Row>
      
                    <Row className="mt-4">
                      <Col>
                        <Form.Label>Date of Birth</Form.Label><br/>
                        <Form.Control placeholder="" className="datepicker"/>
                      </Col>
                      <Col>
                        <Form.Label>Teacher ID</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                    </Row>
      
                    <Row className="mt-4">
                      <Col>
                        <Form.Label>Address</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                      <Col>
                        <Form.Label>Phone Number</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                    </Row>
      
                    <Row className="mt-4">
                      <Col>
                        <Form.Label>Father Name</Form.Label>
                        <Form.Control placeholder="" />
                      </Col>
                      <Col>
                        <Form.Label>Transportation</Form.Label>
                        <Form.Control placeholder="" as="select">
                          <option selected>None</option>
                          <option>Transport1</option>
                          <option>Transport2</option>
                          <option>Transport3</option>
                        </Form.Control>
                      </Col>
                    </Row>
      
                    <Row className="mt-4">
                      <Col>
                      <Button variant="primary" className="btn btn-primary btn-lg btn-block">SAVE</Button>
                      </Col>
                    </Row>
                  </Form>
      
                </Card>
      
              </Col>
      
            <Col sm={4}>
              <Row>
                <Card style={{ width: '18rem' }}>
                  <img src='data:image/jpeg;base64,' 
                        className='img-rounded' 
                        alt='profile-image'/>
                </Card>
              </Row>
              <Row className="mt-2">
                <Card style={{ width: '18rem', padding : '8px' }}>
                  <h5>Schedule</h5>
                  <ReactTable
                        columns = {columns}
                        data = {data}
                        showPagination = {true}
                        showPaginationBottom={true}
                        defaultPageSize={5}
                        showPageSizeOptions = {false}
                    ></ReactTable>
                  
                </Card>
              </Row>
            </Col>
      
          </Row>
          
          </Container>
          
          </div>
        );
      }
}

export default AdminTeacherProfile;
